import React, { Component } from 'react';

import styled from 'styled-components';

class About extends Component {

    render(){
        return(
            <div>
                <h1>백엔드는 Spring Boot를 사용하였고</h1>
                <h1>프론트엔드는 React를 사용하였습니다.</h1>
                <h1>DB는 아마존의 RDS와 MariaDB를 사용하였고</h1>
                <h1>서버는 아마존의 AWS를 사용하였습니다.</h1>
            </div>
            
        )
    }

}

export default About;
